import React, { Component } from 'react';
import axios from 'axios';
import UsersTable from './UsersTable';

export default class UsersComponent extends React.Component {

    constructor(props) {
        super(props)

        this.state = {
            usersComponentState: ""
        }
    }

    componentDidMount() {
        axios.get('http://localhost:3000/users')
            .then((data) => {
                this.setState({ usersComponenState:data 
                }, () => {
                    console.log(this.state.usersComponentState)
                })
            })
            .catch((error) => {
                console.log(error);
            })
    }

    usersTable() {
        return this.state.usersComponentState.map((data, i) => {
            return <UsersTable obj={data} key={i} />;
        });
    }

    render() {
        return (
            <div className="wrapper-users">
                <div className="container">
                    <table className="table table-striped table-dark">
                        <thead className="thead-dark">
                            <tr>
                                <td>ID</td>
                                <td>num</td>
                                <td>first_Name</td>
                                <td>last_Name</td>
                                <td>Email</td>
                                <td>Gender</td>
                                <td>ip_Address</td>
                            </tr>
                        </thead>
                        <tbody>
                            {this.UsersTable()}
                        </tbody>
                    </table>
                </div>
            </div>
        )
    }
}
